 /* 创建表结构 `ssc_bets` */
 DROP TABLE IF EXISTS `ssc_bets`;/* MySQLReback Separation */ CREATE TABLE `ssc_bets` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `wjorderId` char(35) CHARACTER SET latin1 NOT NULL COMMENT '随机订单号',
  `serializeId` char(35) CHARACTER SET latin1 NOT NULL COMMENT '投注号，由后台生成',
  `uid` int(11) NOT NULL COMMENT '投注用户ID',
  `username` varchar(32) CHARACTER SET latin1 NOT NULL DEFAULT '' COMMENT '投注人帐号',
  `nickname` varchar(32) NOT NULL,
  `type` tinyint(4) NOT NULL COMMENT '投注种类，对应ssc_type.id',
  `playedGroup` smallint(6) NOT NULL COMMENT '玩法组ID',
  `playedId` int(11) NOT NULL COMMENT '玩法ID',
  `Groupname` varchar(32) DEFAULT NULL,
  `actionNo` varchar(32) CHARACTER SET latin1 NOT NULL COMMENT '投注期号',
  `actionData` longtext NOT NULL COMMENT '投注号码',
  `actionTime` int(11) NOT NULL COMMENT '投注时间',
  `actionIP` int(11) NOT NULL COMMENT '投注IP',
  `odds` float(10,3) NOT NULL,
  `rebate` float(10,5) NOT NULL DEFAULT '0.00000' COMMENT '退水比例',
  `rebateMoney` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '退水金额',
  `fanDian` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '返点',
  `fanDianAmount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '支付的所有返点',
  `bonus` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '中奖金额不包括退水金额',
  `money` int(11) NOT NULL DEFAULT '0' COMMENT '倍数',
  `lotteryNo` varchar(32) NOT NULL DEFAULT '' COMMENT '开奖号码，没开奖的留空串',
  `kjTime` int(11) NOT NULL DEFAULT '0' COMMENT '官方开奖时间',
  `zjCount` smallint(6) NOT NULL DEFAULT '0' COMMENT '中奖注数',
  `flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '识别盈亏0为亏1为赢',
  `isDelete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已经取消购买，一般在开奖之前都可以取消购买',
  `orderId` bigint(35) NOT NULL COMMENT '定单号，由前台生成',
  `totalNums` smallint(6) NOT NULL DEFAULT '1' COMMENT '投注组数,用于复选投注,默认1注',
  `totalMoney` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '投注总金额,用于复选',
  `betInfo` varchar(32) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`) USING BTREE,
  KEY `uid` (`uid`),
  KEY `actionTime` (`actionTime`),
  KEY `kjTime` (`kjTime`),
  KEY `wjorderId` (`wjorderId`),
  KEY `actionNo` (`actionNo`),
  KEY `zjCount` (`zjCount`),
  KEY `bonus` (`bonus`)
) ENGINE=MyISAM AUTO_INCREMENT=13569 DEFAULT CHARSET=utf8 COMMENT='投注表';/* MySQLReback Separation */
