 /* 创建表结构 `ssc_bonus_log` */
 DROP TABLE IF EXISTS `ssc_bonus_log`;/* MySQLReback Separation */ CREATE TABLE `ssc_bonus_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) unsigned NOT NULL,
  `username` varchar(16) NOT NULL,
  `bonusAmount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '本期分红金额',
  `lossAmount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '本期盈亏总额',
  `startTime` int(11) NOT NULL COMMENT '本期分红开始时间',
  `endTime` int(11) NOT NULL COMMENT '本期分红结束时间',
  `bonusTime` int(11) NOT NULL COMMENT '分红发放时间',
  `bonusStatus` tinyint(3) NOT NULL DEFAULT '0' COMMENT '分红发放状态',
  `isDelete` tinyint(3) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=16 DEFAULT CHARSET=latin1;/* MySQLReback Separation */
 /* 创建表结构 `ssc_coin_log` */
 DROP TABLE IF EXISTS `ssc_coin_log`;/* MySQLReback Separation */ CREATE TABLE `ssc_coin_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL COMMENT '用户ID',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '彩种类，对应ssc_type.id，如果与彩票无关，这采用默认值(比如充值)',
  `playedId` int(11) NOT NULL DEFAULT '0',
  `coin` float(10,2) NOT NULL DEFAULT '0.00' COMMENT '流动资金',
  `userCoin` float(10,2) NOT NULL DEFAULT '0.00' COMMENT '余额',
  `fcoin` float(10,2) NOT NULL COMMENT '流动冻结资金，消费的用负值，充值的用正',
  `liqType` tinyint(3) unsigned NOT NULL COMMENT '1充值，2返点，3提现失败从冻结资金返回，4撤单资金，5中奖派奖... ，101提现，102投注，103提现资金冻结，104开奖扣除冻结资金...,105退水',
  `actionUID` int(11) NOT NULL DEFAULT '0' COMMENT '操作用户ID',
  `actionTime` int(11) NOT NULL DEFAULT '0',
  `actionIP` int(11) NOT NULL DEFAULT '0' COMMENT '由系统生成或管理员操作的采用默认值',
  `info` varchar(64) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '备注信息',
  `extfield0` bigint(20) NOT NULL DEFAULT '0',
  `extfield1` varchar(32) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '扩展字段1',
  `extfield2` varchar(32) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '扩展字段2',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`) USING BTREE,
  KEY `uid` (`uid`),
  KEY `type` (`type`),
  KEY `playedId` (`playedId`) USING BTREE,
  KEY `coin` (`coin`) USING BTREE,
  KEY `fcoin` (`fcoin`) USING BTREE,
  KEY `info` (`info`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=18491 DEFAULT CHARSET=latin1 COMMENT='用户资金流动日志表';/* MySQLReback Separation */
