  KEY `uid` (`uid`),
  KEY `actionTime` (`actionTime`),
  KEY `kjTime` (`kjTime`),
  KEY `wjorderId` (`wjorderId`),
  KEY `actionNo` (`actionNo`),
  KEY `zjCount` (`zjCount`),
  KEY `bonus` (`bonus`)
