 /* 创建表结构 `ssc_guestmembers` */
 DROP TABLE IF EXISTS `ssc_guestmembers`;/* MySQLReback Separation */ CREATE TABLE `ssc_guestmembers` (
  `uid` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `isDelete` tinyint(1) NOT NULL DEFAULT '0',
  `enable` tinyint(1) NOT NULL DEFAULT '1',
  `gudongId` int(10) NOT NULL DEFAULT '0',
  `zparentId` int(10) NOT NULL DEFAULT '0' COMMENT '总代理',
  `parentId` int(10) NOT NULL DEFAULT '0' COMMENT '上级代理',
  `admin` tinyint(1) NOT NULL DEFAULT '0',
  `username` varchar(16) NOT NULL,
  `password` char(32) NOT NULL,
  `coinPassword` char(32) NOT NULL DEFAULT '',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否代理：0会员，1代理,2总代理,3股东',
  `panid` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1为A盘玩法,2为B盘玩法',
  `nickname` varchar(16) CHARACTER SET utf8 NOT NULL,
  `name` varchar(16) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '用户真实姓名',
  `regIP` int(11) NOT NULL,
  `regTime` int(11) NOT NULL,
  `updateTime` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  `coin` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '个人财产',
  `fcoin` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '冻结资产',
  `fanDian` float(3,1) NOT NULL DEFAULT '0.0' COMMENT '用户设置的返点数',
  `rebate` float(10,3) NOT NULL DEFAULT '0.000' COMMENT '玩法退水',
  `maxMoney` int(10) NOT NULL DEFAULT '0' COMMENT '单注最高投注',
  `maxTurnMoney` int(10) NOT NULL DEFAULT '0' COMMENT '单期最高投注',
  `email` varchar(16) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `qq` varchar(16) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `phone` varchar(16) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `src` varchar(32) CHARACTER SET gbk NOT NULL DEFAULT '' COMMENT '账号来源',
  `testFlag` tinyint(1) DEFAULT '0',
  `mLetterStatus` tinyint(1) NOT NULL DEFAULT '1' COMMENT '站内信开关',
  `conCommStatus` tinyint(3) NOT NULL DEFAULT '0' COMMENT '消费佣金发放状态',
  `lossCommStatus` tinyint(3) NOT NULL DEFAULT '0' COMMENT '亏损佣金发放状态',
  `xuni` tinyint(1) DEFAULT NULL COMMENT '虚拟帐号 ',
  `grade` tinyint(4) NOT NULL DEFAULT '1' COMMENT '等级',
  `care` varchar(16) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '积分',
  `scoreTotal` int(11) NOT NULL DEFAULT '0' COMMENT '累计积分',
  `fanDianBdw` float(3,1) NOT NULL DEFAULT '0.0' COMMENT '不定位返点',
  `deposit` float(10,2) NOT NULL DEFAULT '0.00' COMMENT '余额宝金额',
  `depositStatus` tinyint(3) NOT NULL DEFAULT '0' COMMENT '余额宝状态',
  `updatePw` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `uid` (`uid`) USING BTREE,
  UNIQUE KEY `username` (`username`) USING BTREE,
  KEY `parentId` (`zparentId`) USING BTREE,
  KEY `parents` (`parentId`) USING BTREE,
  KEY `nickname` (`nickname`) USING BTREE,
  KEY `coin` (`coin`) USING BTREE,
  KEY `fanDian` (`fanDian`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=435 DEFAULT CHARSET=latin1;/* MySQLReback Separation */
