 /* 创建表结构 `ssc_member_recharge` */
 DROP TABLE IF EXISTS `ssc_member_recharge`;/* MySQLReback Separation */ CREATE TABLE `ssc_member_recharge` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
