 DROP TABLE IF EXISTS `ssc_played2`;/* MySQLReback Separation */ CREATE TABLE `ssc_played2` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(16) CHARACTER SET utf8 NOT NULL COMMENT '玩法名称',
  `alias` varchar(64) CHARACTER SET utf8 DEFAULT NULL,
  `code` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '玩法拼音',
  `type` tinyint(4) NOT NULL COMMENT '彩种ID',
  `played_groupid` tinyint(4) NOT NULL DEFAULT '0' COMMENT '玩法组ID',
  `odds` decimal(10,3) NOT NULL DEFAULT '0.000' COMMENT '赔率',
  `oddsDouble` decimal(10,3) NOT NULL DEFAULT '0.000',
  `rebate` decimal(10,3) NOT NULL DEFAULT '0.000' COMMENT '玩法退水',
  `rebateDouble` decimal(10,3) NOT NULL DEFAULT '0.000',
  `minMoney` int(10) NOT NULL DEFAULT '0' COMMENT '单注最低投注',
  `maxMoney` int(10) NOT NULL DEFAULT '0' COMMENT '单注最高投注',
  `maxTurnMoney` int(10) NOT NULL DEFAULT '0' COMMENT '单期最高投注',
  `ruleFun` varchar(32) NOT NULL DEFAULT '' COMMENT '中奖规则函数',
  `betCountFun` varchar(32) NOT NULL DEFAULT '',
  `enable` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1为开启0为关闭',
  `android` tinyint(1) NOT NULL DEFAULT '0',
  `sort` int(4) NOT NULL DEFAULT '0',
  `info` varchar(255) CHARACTER SET utf8 NOT NULL COMMENT '玩法说明',
  `simpleInfo` varchar(255) CHARACTER SET utf8 NOT NULL COMMENT '玩法简单说明',
  `example` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '中奖举例',
  `selectNum` tinyint(4) NOT NULL COMMENT '每注选几个号码',
  `zjMax` varchar(64) NOT NULL DEFAULT '' COMMENT '最大中奖号码计算函数',
  `playedTpl` varchar(64) NOT NULL DEFAULT '' COMMENT '玩法页面模板',
  `isBan` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `bonusProp` (`name`,`enable`,`type`,`odds`,`rebate`) USING BTREE,
  KEY `playedTpl` (`betCountFun`,`zjMax`,`playedTpl`,`maxTurnMoney`) USING BTREE,
  KEY `example` (`example`) USING BTREE
