 /* 创建表结构 `ssc_played_group` */
 DROP TABLE IF EXISTS `ssc_played_group`;/* MySQLReback Separation */ CREATE TABLE `ssc_played_group` (
  `id` smallint(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(64) CHARACTER SET utf8 NOT NULL COMMENT '玩法名称',
  `type` tinyint(4) NOT NULL COMMENT '彩种ID',
  `code` varchar(64) NOT NULL COMMENT '玩法名称拼音大写',
  `isShow` tinyint(1) NOT NULL DEFAULT '0' COMMENT '投注确认时是否显示玩法名称0为显示,1为不显示',
  `sort` int(4) NOT NULL DEFAULT '0',
  `enable` tinyint(1) NOT NULL DEFAULT '1' COMMENT '玩法开启,0为关闭,关闭后不显示',
  `android` tinyint(1) NOT NULL DEFAULT '0',
  `info` varchar(32) CHARACTER SET utf8 NOT NULL COMMENT '玩法组介绍',
  `isBan` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `enable` (`enable`,`type`,`name`,`sort`,`code`)
