  `betCount` int(11) NOT NULL DEFAULT '0' COMMENT '投注数',
  `betAmount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '投注金额',
  `zjAmount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '中奖金额',
  `rebateMoney` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '退水金额',
  `uid` int(11) NOT NULL COMMENT '投注用户ID',
  `username` varchar(32) DEFAULT '' COMMENT '投注人帐号',
  `gudongId` int(10) NOT NULL DEFAULT '0',
  `zparentId` int(10) NOT NULL DEFAULT '0' COMMENT '总代理',
  `parentId` int(10) NOT NULL DEFAULT '0' COMMENT '上级代理',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '彩种ID',
  `playedId` smallint(6) NOT NULL DEFAULT '0' COMMENT '玩法ID',
  PRIMARY KEY (`id`),
  KEY `betCount` (`betCount`) USING BTREE,
  KEY `betAmount` (`betAmount`) USING BTREE,
  KEY `zjAmount` (`zjAmount`) USING BTREE,
  KEY `type` (`date`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=147 DEFAULT CHARSET=latin1;/* MySQLReback Separation */
